import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Import all your page and layout components
import AppStyles from './AppStyles';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './components/HomePage';
import AboutUsPage from './components/AboutUsPage';
import ContactUsPage from './components/ContactUsPage';
import EnrollNowPage from './components/EnrollNowPage';
import BlogPage from './components/BlogPage';
import CollegeListPage from './components/CollegeListPage';
import CollegeDetailPage from './components/CollegeDetailPage';

// Import Admin components
import AdminLogin from "./components/Admin/AdminLogin.jsx";
import AdminDashboard from "./components/Admin/AdminDashboard.jsx";


export default function App() {
  // State to manage admin login status, checked from localStorage
  const [isAdminLoggedIn, setIsAdminLoggedIn] = useState(!!localStorage.getItem('adminToken'));

  return (
    <Router>
      <AppStyles />
      <Header />
      <main>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element = {<AboutUsPage/>} />
          <Route path='/contact' element = {<ContactUsPage/>}/>
          <Route path='/enrollnow' element = {<EnrollNowPage/>}/>
          <Route path='/blog' element ={<BlogPage/>}/>
          <Route path="/colleges/:stream" element={<CollegeListPage />} />
          <Route path="/colleges/:stream/:collegeName" element={<CollegeDetailPage />} />

          {/* Admin Routes */}
          <Route 
              path="/admin" 
              element={isAdminLoggedIn ? <Navigate to="/admin/dashboard" /> : <AdminLogin onLogin={setIsAdminLoggedIn} />} 
          />
          <Route 
              path="/admin/dashboard" 
              element={isAdminLoggedIn ? <AdminDashboard /> : <Navigate to="/admin" />} 
          />

          {/* Fallback route to redirect to home */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </main>
      <Footer />
    </Router>
  );
}
